import { useState } from "react";
import { useEffect } from "react";

export default function LikedVideosComponent({ userInfo, index }){
    const [likedvideos, setLikedVideos] = useState([]);

    useEffect(() => {
        fetch(`http://localhost:8000/api/liked_videos_api`, {
                method: 'GET',
                credentials: 'include',
            })
            .then(response => {
                if (response.status === 200) {
                    return response.json();
                } else {
                    throw new Error('Failed to fetch liked videos');
                }
            })
            .then(data => {
                setLikedVideos(data);
            })
            .catch(error => {
                console.error('Error fetching user info:', error);
            });
    }, [])

    return (
        <>
            <div className="likedvideosouter">
                <div className="likedvideosheader">
                    <h4>Liked videos</h4>
                    <div className="likedrow">
                        <label>Private</label>
                        <span>{userInfo.username}</span>
                        <span></span>
                    </div>
                    <div className="videocontain">
                        {likedvideos.map}
                    </div>
                </div>
            </div>
        </>
    )
}
